VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 13, 'ally with the very aggressive human glioma stem cells (GSC) MES-1123 and treated as described above. Untreated mice implanted intra-cranially with 2.5 × 10 The IGF-Trap also inhibits the growth of orthotopically implanted human glioma stem cell xenografts. NSG mice were implanted intra-cerebrally with 2.5 × 10 Continuous drug administration via a cerebrally implanted cannula, while it may be effective in delivering the drug to the tumor site, is challenging in the clinical setting. Optimally, drugs should access the brain from the circulation in high enough concentrations to affect local tumor growth. However, access to large biologics such as antibodies and the IGF-Trap is hindered by the BBB. Strategies to increase penetrability of biologics into the brain for the treatment of malignant disease are therefore actively being sought. We selected to use a nanoparticle (NP)-based delivery approach for increased IGF-Trap delivery and retention in the brain.', '{0.21495364606380463,-0.2688441276550293,-0.4515032470226288,-0.34600377082824707,0.23053523898124695,0.025576913729310036,0.09031993895769119,-0.15521016716957092,-0.6045295000076294,0.5427622199058533,0.13390198349952698,-0.5099319815635681,0.07424614578485489,-0.6151546239852905,-0.25032615661621094,-0.47607478499412537,-0.027489949017763138,0.5303431749343872,-0.08304232358932495,0.42266061902046204,-0.20718900859355927,0.32633695006370544,-0.21301406621932983,-0.22075273096561432,0.055208973586559296,0.3952120542526245,-0.11257410049438477,-0.016025153920054436,0.4673234224319458,0.29006266593933105,-0.7509203553199768,0.4600147008895874,0.4368349015712738,0.9632038474082947,-0.24362267553806305,0.5834963321685791,0.2210053950548172,0.158039852976799,0.4808410108089447,-0.3513624370098114,0.32217466831207275,0.38137638568878174,-0.5801723599433899,-0.3061542510986328,0.5034254193305969,0.15680354833602905,0.08852170407772064,-0.715257346