VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 19, 'IGF-axis may be clinically beneficial, particularly if enough of the drug can reach the tumor site. Similar results were reported by Zamykal et al, using mice that were orthotopically implanted with U87 cells and treated with the IGF-1R targeting antibody IMC-A12 delivered to the tumor site via an intra-cerebrally implanted catheter. Continuous direct intracranial drug delivery is clinically challenging. We therefore sought to use a non-invasive method to optimize the potential clinical utility of the IGF-Trap for GBM treatment. Nanomedicine has emerged as an important platform for increasing drug delivery and efficacy for cancer treatment. In contrast to other studies where the levels of N-trimethyl chitosan-encapsulated agents in the brain were evaluated postmortem, We observed that the injection of free IGF-Trap intravenously also reduced the intracerebral growth of the GL261 tumors, although the effect did not reach statistical significance when compared to vehicle-treated mice.', '{0.2923184037208557,-0.5230168104171753,-0.5251902937889099,-0.6749300956726074,0.027280304580926895,-0.07242009043693542,-0.2682858109474182,-0.16806800663471222,-0.3673156797885895,0.4827021360397339,0.08051975816488266,-0.6985225081443787,0.12503595650196075,-0.5231261253356934,-0.0207662433385849,-0.5654758214950562,-0.2929723858833313,0.2522013783454895,-0.12489863485097885,0.5942177772521973,-0.1730591505765915,0.1171281486749649,0.010664663277566433,0.19452817738056183,-0.25085362792015076,0.3076041340827942,-0.31374067068099976,0.2500629425048828,0.4396650195121765,-0.1823984533548355,-0.6317620277404785,0.295960009098053,0.20595963299274445,0.44869402050971985,-0.13109689950942993,0.7312067151069641,0.15438655018806458,0.019051462411880493,1.0461848974227905,-0.3702591061592102,0.2696937024593353,0.6259533166885376,-0.7450183629989624,-0.48226433992385864,0.2145010530948639,0.2849575877189636,0.043747711