VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 20, 's, although the effect did not reach statistical significance when compared to vehicle-treated mice. This, more modest, effect may be due to the reduction in the bioavailability of circulating IGF-1 and IGF-2 that can cross the BBB due to their small size (7–7.5 kD) In this study, when administering IGF-Trap systemically (as free IGF-Trap or NP-encapsulated), we pretreated the mice prior to intracerebral tumor cell injection in order to reduce the bioavailability of locally produced ligands in the brain. We therefore cannot rule out the possibility that IGF-Trap in this setting, also affected initial tumor cell engraftment in the brain. Although this treatment regimen is obviously impracticable in the clinical setting for the management of primary GBM, it may have utility in prevention of tumor recurrence. Furthermore, in this study, we used IGF-Trap as a monotherapy.', '{0.04092005640268326,-0.26979145407676697,-0.7019338011741638,-0.6950534582138062,0.320205956697464,-0.2936869263648987,0.05369091033935547,-0.28280118107795715,-0.19219349324703217,0.5359389185905457,0.2876806855201721,-0.6631291508674622,-0.5842996835708618,-0.6732629537582397,0.03094542771577835,-0.7936787009239197,0.24559132754802704,0.2763950526714325,0.18848153948783875,0.4763904809951782,0.10253233462572098,0.2530963718891144,-0.03744540736079216,0.12341117113828659,-0.2713009715080261,0.3517531156539917,-0.17355455458164215,0.10729525983333588,0.2551429867744446,0.15256094932556152,-0.8543826341629028,0.5906951427459717,0.20549799501895905,0.48724818229675293,0.0016643585404381156,0.8187626004219055,-0.44568929076194763,-0.052418772131204605,0.3636241555213928,-0.44444864988327026,0.7031391263008118,0.35986706614494324,-0.6485358476638794,-0.4939531087875366,0.2485731691122055,0.28632813692092896,-0.4437779188156128,-0.6794916391372681,0.475956529378891,-0.40955179929733276,-0.23295144736766815,-0.3177967369556427,0.122