VALUES ('Development and validation of a molecular classifier of meningiomas', 'Meningiomas exhibit considerable clinical and biological heterogeneity. We previously identified 4 distinct molecular groups ( Using an international cohort of 1698 meningiomas, we constructed and rigorously validated a machine learning-based molecular classifier using only DNA methylation data as input. Original and newly predicted molecular groups were compared using DNA methylation, RNA sequencing, copy number profiles, whole-exome sequencing, and clinical outcomes. We show that group-specific outcomes in the validation cohort are nearly identical to those originally described, with median progression-free survival (PFS) of 7.4 (4.9–Inf) years in  Our DNA methylation-based classifier, which is publicly available for immediate clinical use, recapitulates the biology and outcomes of the original molecular groups as assessed using multiple metrics/platforms that were not used in its training. We develop a methylation-based tool to prospectively classify meningiomas into molecular groups. Predicted groups strongly recapitulate expected clinical and biological profiles. This will allow increasingly personalized care for patients with meningioma. We previously showed that molecular groups of meningioma, identified by combining multiple genomic approaches, can successfully resolve much of the disease heterogeneity that has limited translational progress in this disease to date. However, their discovery using high-dimensional clustering approaches and multi-omics data does not lend itself readily to classifying prospective cases in the clinical setting. Here we present a point-and-click tool to classify prospective meningioma cases into their respective molecular group using DNA methylation alone. Using multiple orthogonal data types including DNA methylation, RNA sequencing, exome sequencing, and clinical outcomes, we show that our model faithfully recapitulates the molecular groups that were originally described using a large, multi-institutional cohort of 1698 cases. This novel tool can be readily integrated into existing DNA methylation-based workflows to increase personalization of patient care and form the basis of molecularly-informed clinical trials for meningioma. We make this tool publicly available. Meningioma, the most common primary intracranial tumor, We previously described 4 consensus molecular groups of meningioma by integrating DNA methylation, transcriptomic, and copy number alterations (CNAs) derived from whole-exome sequencing data To address this critical gap and translate the biologic insights of these novel molecular groups into clinical practice, we focused on adapting a multiplatform description of molecular classification into a more convenient single platform approach by building a classifier that predicts meningioma molecular group classification using only raw DNA methylation files as input. We used DNA methylation to anchor this classifier since CNAs can be inferred from these data, and because methylation-based classifiers have gained considerable traction in the clinical care of brain tumor patients. The cohort for this study was generated by using a combination of previously published cases analyzed by our group, datasets made publicly available, and additional cases we obtained for this new analysis. Our total study cohort was divided into a discovery cohort and a validation cohort. The discovery cohort included a previously published cohort used to describe the original 4 molecular groups. Sample acquisition and processing have been described in detail previously. Between 250 and 500 ng of extracted DNA was bisulfite converted using the EZ DNA Methylation Kit followed by methylation profiling using the Illumina 850k EPIC array. Raw output (.idat files) were imported, preprocessed, and ssNoob normalized using the  We inferred chromosome arm-level gains and losses using the  Extracted RNA was paired-end sequenced on the Illumina HiSeq 2500 to target 70 million reads per sample. Output fastq files were aligned to the GRCh38 human reference genome using the STAR aligner. All samples in the discovery cohort, as well as prospective samples from the prospective RTOG-0539 clinical trial, underwent whole-exome sequencing. Mutational data from a publicly available cohort In addition, amplification of the  To predict molecular groups, we used elastic net classifiers which were optimized using 10-fold cross validation repeated 3 times on the discovery cohort, where the true label was defined as the original molecular group assignment. For each sample in this cohort, a predicted molecular group (MG) was generated by training models on all remaining samples ( For feature selection, differential methylation analysis was performed in a pairwise fashion between each input group label using the  Once the model configuration was determined, an elastic net classifier (a form of regularized logistic regression) was trained using the full discovery cohort and used to predict the molecular group on our combined validation cohort. The training parameters were identical to those used in the model optimization. The biological profiles of these predicted molecular groups were compared to the molecular descriptions of the original cohort using methylation, clinical, and orthogonal genomic data (RNA sequencing and somatic point mutation data from whole-exome sequencing). Inferred copy number changes were also compared between cohorts, with a specific focus on canonical MG-specific gains/losses such as loss of chromosome 1p, gain of chromosome 1q, and loss of chromosome 22q. A subset of the validation cohort with available RNA sequencing data was used as further validation of the biological recapitulation of our original molecular groups. Single sample gene set variation analysis (ssGSVA), Within the validation cohort, differential gene expression analysis was performed between each predicted molecular group and the remaining samples ( As further validation of our predicted molecular groups, we compared the inferred cell proportions in our discovery and validation cohorts using CIBERSORTx. For continuous variables, a student’s  Full details of our discovery ( Baseline Characteristics of the Discovery and Validation Cohorts Bold values indicate  Given the previous finding that  Predicted molecular groups recapitulate the methylation signatures, inferred copy number profiles, and outcomes of the original molecular groups. (A) Model diagram, depicting information flow from model 1 to model 2 with additional CNA-based refinement. (B) Distribution of methylation model probability scores in both models based on final predictions (excluding cases that were reassigned based on CNV profile). (C) Barplots depicting the proportion of samples in each molecular group with canonical CNAs among the validation cohort (predicted, top) and the discovery cohort (original, bottom). (D) Group-specific Kaplan Meyer survival curves are plotted for the validation cohort (left), the prospective RTOG-0539 cohort (a subset of the validation cohort, middle), and the discovery cohort (right). Vertical lines represent median progression-free survival. To apply these trained models to our validation cohort, processed beta-values were input into model 1, and preliminary molecular groups were assigned based on the highest output probability. Cases assigned as “ Given that stereotypical CNAs were specific to some molecular groups in their original description, we refined the methylation model output using CNA data inferred from DNA methylation (effectively creating a 3-layer model using only DNA methylation as input data). Based on findings from our discovery cohort, cases with the presence of both 1p loss and either 1q gain or 10 (p or q) loss, while rare, were assigned as  We applied the complete 3-layer classifier to all samples in the validation cohort, classifying 1378/1577 (87.4%) of cases. Of these 1378 cases, 68 (4.9%) cases had final assignments that were refined by their inferred CNV profiles. Two hundred and seventy-three cases (19.8%) were classified as  Given the observation that specific chromosome arms are stereotypically gained or lost in an MG-specific manner, we also compared inferred copy number changes of our final MG predictions in the validation cohort to those described in the original discovery cohort ( Of the 199 “undifferentiated” cases which were not confidently assigned to a single group, 65 (32.7%) had final output model probabilities <0.5 and 134 (67.3%) were assigned as  We next sought to compare molecular group-specific outcomes in the validation cohort to the discovery cohort ( We next sought to further validate the biological fidelity of the predicted molecular groups using orthogonal genomic platforms, which were not used in our classifier’s training or predictions. We first investigated the somatic point mutation profiles of a subset of the validation cohort with available whole-exome sequencing ( Validation of predicted molecular groups using orthogonal genomic platforms. (A) Whole-exome sequencing reveals similar molecular group-specific patterns of mutations between cohorts, with  Given that the transcriptional profiles of the originally described consensus molecular groups were highly distinct, we used RNA sequencing to further characterize the biology of predicted molecular groups in the validation cohort ( As further confirmation of the transcriptome-level validity of our predicted molecular groups, we computed the expression of group-specific gene signatures generated during the initial discovery of these groups Finally, we inferred the relative proportions of neoplastic cells, macrophages,  The inclusion of TERT promoter mutations and CDKN2A deletions to classify meningioma represents a significant update to the longstanding histopathology-based WHO criteria. While methylation profiling is not currently part of the standard of care in meningioma management and is not available at many laboratories, it is becoming increasingly accessible as the cost of genomic profiling decreases, further mitigated by using microarray-based technologies Our institution routinely applies a previously published DNA methylation-based nomogram to stratify meningiomas into high and low risk groups, The results of our study should be considered in the context of some limitations. First, the labels in our training are based on assignments from prior clustering analyses, which are associated with inherent stochasticity. Basing our classifier on a different datatype such as RNA sequencing, furthermore, may have led to differing results;

