VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'al molecular groups as assessed using multiple metrics/platforms that were not used in its training. We develop a methylation-based tool to prospectively classify meningiomas into molecular groups. Predicted groups strongly recapitulate expected clinical and biological profiles. This will allow increasingly personalized care for patients with meningioma. We previously showed that molecular groups of meningioma, identified by combining multiple genomic approaches, can successfully resolve much of the disease heterogeneity that has limited translational progress in this disease to date. However, their discovery using high-dimensional clustering approaches and multi-omics data does not lend itself readily to classifying prospective cases in the clinical setting. Here we present a point-and-click tool to classify prospective meningioma cases into their respective molecular group using DNA methylation alone.', '{0.10997560620307922,0.18963266909122467,0.5468459725379944,-0.9736200571060181,-0.4661150276660919,-0.8402647972106934,-0.87928706407547,-0.6882616877555847,-0.41119396686553955,0.2469809353351593,-0.6612396240234375,0.23305994272232056,0.689620316028595,0.351056307554245,-1.2674455642700195,0.4585060179233551,0.38072454929351807,-0.031259071081876755,-0.814444899559021,0.2867289185523987,0.1846427470445633,-0.609589695930481,0.05220584198832512,-0.30213111639022827,-0.9442205429077148,-0.4048086702823639,0.36573123931884766,-0.0944671779870987,-0.2100769430398941,0.6424179077148438,-0.08248716592788696,-0.5628643035888672,0.19966214895248413,-0.4977240264415741,-0.3784632682800293,-0.042420677840709686,0.2422512322664261,-0.15065400302410126,-0.08782977610826492,-0.08858097344636917,0.4693877398967743,0.23757150769233704,0.16868501901626587,-0.35378459095954895,0.4321810305118561,-0.05151181295514107,-0.4597901701927185,-0.32408300042152405,0.9979067444801331,0.02006763219833374,-0.233358517