VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'sify prospective meningioma cases into their respective molecular group using DNA methylation alone. Using multiple orthogonal data types including DNA methylation, RNA sequencing, exome sequencing, and clinical outcomes, we show that our model faithfully recapitulates the molecular groups that were originally described using a large, multi-institutional cohort of 1698 cases. This novel tool can be readily integrated into existing DNA methylation-based workflows to increase personalization of patient care and form the basis of molecularly-informed clinical trials for meningioma. We make this tool publicly available.', '{0.06600569188594818,-0.08663155883550644,0.37628650665283203,-1.3350017070770264,-0.006405805703252554,-0.7890400886535645,-0.32672104239463806,-0.6144732236862183,-0.4152815639972687,0.21187303960323334,-0.5786746740341187,-0.15744563937187195,0.6346214413642883,0.06051669269800186,-0.8941985368728638,0.4941481351852417,0.0727900043129921,0.17551004886627197,-0.8212686777114868,0.6413276791572571,0.23033741116523743,-0.17954497039318085,0.22101956605911255,-0.20667129755020142,-0.9851966500282288,-0.6315268874168396,-0.06173529475927353,0.03864192217588425,0.2769056260585785,0.35701873898506165,-0.1851711869239807,-0.25762081146240234,0.33676016330718994,-0.020342297852039337,-0.5650425553321838,-0.24044169485569,-0.11435849219560623,0.052241843193769455,0.07564879953861237,0.015749091282486916,0.7571545243263245,-0.029173169285058975,-0.34486591815948486,0.11937351524829865,-0.20247729122638702,-0.07644736766815186,-0.5095229148864746,-0.4216880202293396,0.8683376312255859,-0.004707841202616692,-0.04390957951545715,-0.2717001438140869,-0.0032482503447681665,-0.25988003611564636,0.4215899705886841,-1.0470733642578125,-0.008823918178677559,0.046316128224134445,1.4301235675811768,-0.18249236047267914,-0.12634986639022827,0.5627456307411194,0.1782262772321701,-0.5433087944984436,1.