VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 15, 'probabilities are low, suggesting a case that is not fully encapsulated by a single molecular group. Of course, this comes with the caveat that a small minority of patients will not have a robust molecular group assignment, and other approaches such as outcome prediction models and copy number profiling will be needed to help prognosticate those cases. Secondly, most samples collected and included in this study were done so in a retrospective manner and so the limitations of retrospective data collection remain. However, the inclusion of valuable prospectively-collected, uniformly treated samples from the RTOG-0539 trial, and the large size and multi-institutional nature of our validation cohort addresses some of these limitations.', '{0.03426050767302513,-0.008561898022890091,0.360205739736557,-0.2972799241542816,-0.6158158183097839,-0.8238682150840759,-0.29358169436454773,-0.3009684681892395,-0.6262092590332031,0.3170245289802551,-0.7497461438179016,0.7314935326576233,0.2488022744655609,0.05307675898075104,-0.4824715554714203,-0.24551890790462494,1.524463415145874,-0.0810920000076294,-0.033588115125894547,0.5558010339736938,-0.2980617582798004,-0.47921812534332275,0.015622437000274658,0.010296259075403214,-0.08367396146059036,-0.04158855974674225,0.19126874208450317,0.2433239072561264,0.06684219837188721,-0.04802528768777847,-0.706744909286499,0.21658213436603546,0.6738064289093018,-0.2267531454563141,0.0542975477874279,0.026003791019320488,-0.25995591282844543,0.5406013131141663,-1.1158632040023804,-0.8644935488700867,0.306369423866272,0.7695026397705078,0.25710469484329224,-0.6240817308425903,-0.08462642133235931,0.22735238075256348,-0.6134741306304932,0.22120800614356995,-0.1793951541185379,-0.119599349796772,-0.42855948209762573,-0.5336123704910278,-0.2816058397293091,0.48628824949264526,0.9986580014228821,-0.49218669533729553,-0.3289259672164917,-0.19192098081111908,0.8660402297973633,0.