VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 3, 'a regional match. The younger cohort included 1855 patients, of whom 53.6% (994 patients) were male. The older patient cohort included 1057 patients, of whom 65% (661 patients) were male. For prevalence calculations, we included all patients who had been diagnosed with HL and were alive in the index year. Incidence data included all patients with a first diagnosis of HL during the study period. This retrospective registry study utilized data collected from six Finnish healthcare registries: the FCR (HL diagnosis), National Institute of Health and Welfare (HL diagnosis, treatments), the Social Insurance Institution of Finland and the Finnish Centre for Pensions (daily sickness allowance, pension, etc. resources), Statistics Finland (socioeconomical status), and Digital and Population Data Services Agency (gathering of controls). These were nationwide registries, as such, the data covered the entire population of Finland (∼5.6 million in 2019).', '{0.23821613192558289,-0.42308399081230164,0.27251896262168884,0.09027484804391861,-0.14489448070526123,-0.3996239900588989,0.8099693059921265,-0.07332878559827805,-1.1009963750839233,0.18247419595718384,-0.3015046715736389,1.0310394763946533,0.6712127923965454,-0.3346421420574188,0.793505847454071,-0.18972881138324738,1.0729538202285767,0.23408181965351105,-0.08438009023666382,-0.3286363184452057,0.47302910685539246,0.042395323514938354,-0.10321450978517532,0.7541371583938599,-0.06467220932245255,-0.2152916043996811,0.4131793677806854,-0.048626452684402466,0.4646848142147064,-0.06106448546051979,-0.06912990659475327,-0.6493675708770752,0.14754945039749146,0.5611638426780701,0.6617446541786194,0.4752015769481659,0.1079397201538086,-0.05469560623168945,-1.134992003440857,0.3382229804992676,0.9242494702339172,0.21291717886924744,0.17502504587173462,-1.1965162754058838,0.12513992190361023,-0.5497400164604187,-0.12204647809267044,0.34767699241638184,0.4253238