VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 8, 'es by age group. (B) The age-standardized prevalence of Hodgkin’s lymphoma for females by age group. Age-standardized prevalence rates and absolute cases numbers of Hodgkin’s lymphoma 
 This study evaluated the trends in the incidence and prevalence of HL in the Finnish population between 2000 and 2019. Our study found two age peaks in the incidence of HL. The incidence rate increased slightly during the study period. We found a remarkable increase in the prevalence of up to two to three times in the oldest age group during study time. HL is a rare type of cancer, accounting for 0.4% of all cancers and of ∼10% of all lymphomas. Its incidence is higher in males than in females [ The aetiology of HL is incompletely understood, however, there are known risk factors. Genetic factors interfere with the aetiology of HL [ Based on our results, comorbidities were more common in patients with HL than in controls in both age groups. However, diagnostic bias cannot be excluded.', '{0.260159432888031,-1.0644350051879883,0.42366665601730347,-0.14274166524410248,-0.42394641041755676,0.03885713219642639,0.812566339969635,-0.6458660960197449,-1.3713456392288208,0.6561124920845032,0.09808720648288727,0.8512217998504639,0.28325408697128296,-0.1272996962070465,0.4638245105743408,0.31084495782852173,1.0478906631469727,0.10456378012895584,0.30714505910873413,-0.38175928592681885,0.41626155376434326,0.4860621392726898,-0.48065465688705444,0.6647335886955261,-0.7892485857009888,-0.4975375831127167,-0.09358473122119904,-0.0811457708477974,-0.05147859826683998,0.05482366308569908,-0.10875669866800308,-0.28337979316711426,0.17660008370876312,0.0189567431807518,0.45776841044425964,0.4605877101421356,0.8204577565193176,-0.34463080763816833,-0.5714638233184814,0.22652100026607513,0.11622590571641922,-0.35247981548309326,0.3412702977657318,-0.8086268305778503,0.10604827105998993,0.09464676678180695,-0.14884671568870544,-0.1513354778289795,-0.09817339479923248,-0.7276716232299805,-0.2228126972913742,0.086324542760849,-0.33777672052383423,-0.10186222940683365,0.05463145673274994,-0.9227554798126221,0.37639519572257996,-0.05030602961778641,0.08605887740850449,0.5811277627944946,0