VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 9, 'n patients with HL than in controls in both age groups. However, diagnostic bias cannot be excluded. Comorbidities are more likely to be diagnosed among patients with HL owing to closer medical examinations. In 2020, the global HL age-adjusted incidence rate was 0.98 per 100 000 [ In a global comparison [ The incidence of HL is lower in the USA than in Finland. In the USA, the age-adjusted incidence was 2.5 per 100 000 per year between 2016 and 2020, and decreased by ∼1.6% per year between 2010 and 2019 [ A previous registry study showed that the incidence varies seasonally, especially at higher latitudes, with the incidence being higher in winter and lower in summer [ Few studies have described the trends in the prevalence of HL [ Unfortunately, HL treatment has toxic late effects, such as secondary malignancies and cardiovascular diseases, which cause excess mortality among long-term survivors.', '{0.07492334395647049,-0.7232555150985718,0.6242304444313049,-0.356922447681427,-0.23443855345249176,0.3974629044532776,0.330441951751709,-0.19685132801532745,-1.2082644701004028,-0.14983193576335907,0.1478564441204071,1.1427303552627563,0.369983434677124,-0.19379064440727234,0.6229557991027832,-0.13828173279762268,0.6816579103469849,-0.18716764450073242,0.3604147732257843,-0.6510793566703796,-0.04606998339295387,0.23438619077205658,-0.1757229119539261,0.41605573892593384,-0.3004647195339203,-0.14874647557735443,-0.2149776816368103,0.3843090236186981,-0.17069905996322632,-0.14171570539474487,-0.292514830827713,-0.21654747426509857,0.14816385507583618,0.11697666347026825,0.10342512279748917,0.5344028472900391,0.5557686686515808,0.13685427606105804,-0.3641201853752136,-0.03466241434216499,0.5603606104850769,0.30346667766571045,0.2731418013572693,-0.9829351305961609,-0.6414322853088379,0.29650232195854187,-0.29206177592277527,-0.007392407860606909,-0.049238141626119614,-0.13420100510120392,-0.15735208988