VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 10, 'ry malignancies and cardiovascular diseases, which cause excess mortality among long-term survivors. MOPP with large-field radiotherapy, MOPP/ABV with or without radiotherapy, BEACOPP (bleomycin, etoposide, doxorubicin, cyclophosphamide, procarbazine, and prednisone) increased the risk of secondary leukaemia and myelodysplastic syndrome, which have a poor prognosis after HL. Radiotherapy increases the risk of breast cancer. The larger the chest radiation field size or dose, the greater the risk. Alkylating chemotherapy, on the other hand, have protective effect against breast cancer. However, the risk of lung and gastrointestinal cancers increases after HL treatment. Large-dose radiotherapy to the mediastinum increases the risk of cardiovascular diseases such as coronary artery disease, valvular disease, pericardial disease, arrhythmia, and cardiomyopathy [ A limitation of this study is the lack of detailed treatment information.', '{-0.17382556200027466,-0.3815886676311493,0.05083063989877701,-0.26699790358543396,0.1371510773897171,0.5791366100311279,0.28441599011421204,-0.40747499465942383,-0.4921585023403168,0.2384602278470993,0.13259044289588928,0.6108102202415466,0.02886394038796425,-0.5600865483283997,0.650054931640625,0.20830212533473969,0.5865445733070374,0.25278639793395996,0.7575852870941162,-0.33425483107566833,0.4615405201911926,0.044753268361091614,0.07686320692300797,0.1761499047279358,-0.08076503872871399,0.21836723387241364,-0.2867724597454071,0.5446628332138062,0.21591401100158691,-0.27646180987358093,-0.7140085101127625,-0.02810651995241642,0.08588869869709015,0.749703049659729,-0.22984831035137177,0.4283909499645233,0.3255675435066223,0.2815413177013397,-1.32419753074646,0.2588117718696594,0.12214691936969757,0.1782550811767578,0.14349818229675293,-0.6611562371253967,-0.4922933280467987,-0.662347137928009,-0.27468129992485046,-0.16923855245113373,-0.7531282901763916,-0.355629