VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 11, 'hmia, and cardiomyopathy [ A limitation of this study is the lack of detailed treatment information. In addition, as a real-world evidence-based study, registry data and errors in recording may exist. However, these registries are, in general, comprehensive, and reliable. The strengths of our study include the possibility to combine multiple registries, high coverage of data collection and a long study period. Despite socioeconomic status, all permanent residents in Finland are entitled to public healthcare, thus the data are nationwide, covering the entire population in Finland. Each patient with a HL was matched to controls by age, sex, and region. In summary, the incidence of HL is high in Finland compared to global rates. The incidence of HL has increased slightly, whereas prevalence has increased considerably. The considerably increased prevalence has resulted in an increasing number of long-term HL survivors in Finland who require follow-up for late effects.', '{-0.1550554633140564,-0.42204397916793823,0.23080848157405853,-0.05373678728938103,-0.47022509574890137,0.028044160455465317,0.7977797985076904,-0.42717039585113525,-1.308773159980774,0.04522942379117012,-0.0030720806680619717,1.2778159379959106,0.6221773624420166,-0.2860993444919586,0.5448134541511536,-0.19899602234363556,0.9745298027992249,0.11049968749284744,0.13315576314926147,-0.4198595881462097,0.5276988744735718,-0.1605032980442047,-0.15135538578033447,0.6691898107528687,0.07007145136594772,-0.1447727233171463,0.1104433685541153,-0.1045680046081543,0.38240110874176025,-0.3602076470851898,0.021574867889285088,-0.588981032371521,0.16925126314163208,-0.18876118957996368,0.4710657596588135,0.2726079821586609,0.0020158314146101475,0.02636883407831192,-0.5816488862037659,-0.05403327941894531,0.49494266510009766,0.08599589765071869,-0.1996012032032013,-1.0680738687515259,-0.19720585644245148,-0.3888889253139496,-0.32964953780174255