VALUES ('Advances in research on the correlation between LTCCBs and cardiovascular diseases: A review', 'The prevalence of cardiovascular diseases has been rising globally, and various therapies have made significant strides in controlling the progression of these conditions and improving prognosis. Among these, pharmacological therapies have evolved rapidly and are increasingly integrated into clinical practice. Pharmacological treatments play a pivotal role in both basic research and clinical applications, particularly in deriving accurate conclusions from drug-related trials to address clinical challenges in drug selection and improve the cure rates of various diseases. L-type calcium channel blockers (LTCCBs) have attracted considerable research attention in recent years. With the accelerated development of novel drugs, the range of LTCCBs-based drug types has also diversified. This review aims to explore the relationship between LTCCBs and conditions such as hypertension, arrhythmias, ischemia–reperfusion injury, and cardiomyopathy, with the goal of contributing to the diversification of treatment options for cardiovascular diseases patients. Additionally, it seeks to establish a theoretical foundation for future research and the clinical application of these therapies. It is imperative to conduct a thorough analysis and in-depth discussion regarding the deficiencies in the medication process as well as various application scenarios. With the advancement of science and the introduction of novel drugs into clinical practice, it is anticipated that these developments will play a critical guiding role in the diagnosis and treatment of complex clinical diseases. Calcium channel blockers (CCBs) are a diverse group of drugs in terms of both structure and function, and they can be classified into dihydropyridines (e.g., nifedipine) and non-dihydropyridines (e.g., verapamil). LTCCs provide the calcium influx necessary to trigger cardiac contraction in a graded manner, regulated by the amplitude and kinetics of the L-type calcium current (ICa-L). The inactivation of LTCCs is controlled by voltage-dependent inactivation and calcium-dependent inactivation, which finely tunes calcium flux. LTCCs, also known as Cav1, are voltage-gated calcium channels that play key roles in a wide range of physiological processes, including neurotransmission, muscle contraction, and gene expression. Dysregulation of calcium channels has been implicated in neurological, cardiovascular, muscular, and psychiatric disorders. The regulation of specific biological processes also depends on the interplay between membrane potential changes and ion concentration shifts. For example, high-voltage-activated calcium channels (Cav1/Cav2) in excitable cells convert action potentials into Ca CCBs remain a cornerstone of pharmacotherapy for CVDs, with their effects demonstrated across a range of drugs. For example, nimodipine, a dihydropyridine CCBs, blocks the influx of extracellular calcium through L-type voltage-gated calcium channels. In 2018, the European Society of Cardiology and the European Society of Hypertension proposed a conventional definition of hypertension, that is, BP ≥ 140/90 mm Hg. A large body of evidence indicates that selecting appropriate drug combinations is crucial for controlling blood pressure. LTCCBs have been widely used as antihypertensive agents in clinical practice. In recent years, many studies have focused on experimental research related to spontaneous hypertension, particularly in terms of blood pressure reduction. Wang et al, As research has progressed, studies on channel-regulating substances have gradually increased. In an experiment by Reyes et al, Arrhythmias typically refer to disturbances in the rate or rhythm of the heartbeat. Sinoatrial node cardiomyocytes exhibit automatic and rhythmic electrical activity, and their rate is influenced by inputs from the autonomic nervous system. For instance, sympathetic nerves increase heart rate by activating the β-adrenergic receptor (β-ARs) signaling cascade, and LTCCs activity facilitates membrane depolarization, serving as a central target of β-ARs signaling. The development of drugs based on plant extracts has become a research hotspot in recent years. Liu et al, Supraventricular tachycardia (SVT) is a common cause of hospital admissions and can cause significant discomfort and distress in patients. The most common types include atrioventricular (AV) nodal reentrant tachycardia, AV reentrant tachycardia, and atrial tachycardia. IR injury is a pathological process that occurs in multiple organs throughout the body, often associated with severe cellular damage and death. A considerable number of studies have demonstrated that different drugs of the same class can exert varying degrees of efficacy in specific conditions. Nessa et al Quercetin has been identified in recent years as a factor with significant therapeutic potential for myocardial IR injury. Liang et al, Significant progress has been made in the taxonomy of myocardial diseases over the past 25 years, with new cardiomyopathies, such as arrhythmogenic, restrictive, and non-compaction cardiomyopathies, being discovered and added to the updated World Health Organization classification. Ca Hypertrophic cardiomyopathy (HCM) is a genetic cardiomyopathy characterized by left ventricular hypertrophy in the absence of conditions such as hypertension. In conclusion, LTCCBs exhibit significant associations with a wide range of CVDs, as evidenced by the multiple studies discussed. Detailed research findings are summarized in “Table  Confirmatory studies investigating the association between LTCCBs and cardiovascular diseases. LTCCBs = L-type calcium channel blockers. As LTCCBs are a subclass of CCBs, the limitations observed in the general application of CCBs provide insight into areas where LTCCBs still require improvement. Dihydropyridine (DHP)-based CCBs are generally preferred in the long-acting formulation, as short-acting CCBs, while effective in lowering blood pressure, often accelerate heart rate and increase myocardial oxygen consumption. Common side effects include palpitations, flushing, headache, and lower limb edema, with occasional gum hyperplasia. Non-DHP CCBs, on the other hand, are typically used as first-line treatment for patients with chronic stable angina;

