VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'ments will play a critical guiding role in the diagnosis and treatment of complex clinical diseases. Calcium channel blockers (CCBs) are a diverse group of drugs in terms of both structure and function, and they can be classified into dihydropyridines (e.g., nifedipine) and non-dihydropyridines (e.g., verapamil). LTCCs provide the calcium influx necessary to trigger cardiac contraction in a graded manner, regulated by the amplitude and kinetics of the L-type calcium current (ICa-L). The inactivation of LTCCs is controlled by voltage-dependent inactivation and calcium-dependent inactivation, which finely tunes calcium flux. LTCCs, also known as Cav1, are voltage-gated calcium channels that play key roles in a wide range of physiological processes, including neurotransmission, muscle contraction, and gene expression. Dysregulation of calcium channels has been implicated in neurological, cardiovascular, muscular, and psychiatric disorders.', '{0.17260216176509857,0.220563143491745,-0.11051550507545471,0.0459626242518425,-0.19638016819953918,-0.1600993126630783,-0.3879689872264862,0.3942824602127075,-0.2114812284708023,-1.0215399265289307,0.4706144332885742,0.9136285781860352,0.1935051530599594,-0.09260901808738708,-1.1654555797576904,-0.24154773354530334,-0.17991921305656433,-0.19241884350776672,0.28008559346199036,-0.3418198525905609,-0.24625013768672943,-0.3056967556476593,-0.44579148292541504,0.4829590320587158,0.056609854102134705,-0.11851181089878082,-0.4436812102794647,-0.3843797445297241,-0.48413318395614624,-0.1179598867893219,-0.33384832739830017,-0.7589969038963318,0.5612639784812927,0.19760635495185852,0.5549057722091675,0.17997513711452484,-0.0722988024353981,0.7120503187179565,-0.7543789744377136,0.21173804998397827,0.3093970715999603,0.43097424507141113,-0.30847448110580444,-0.7991438508033752,-0.395905077457428,-0.32100364565849304,0.4603395164012909,0.2371145486831665,0.655530810356