VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 3, 'm channels has been implicated in neurological, cardiovascular, muscular, and psychiatric disorders. The regulation of specific biological processes also depends on the interplay between membrane potential changes and ion concentration shifts. For example, high-voltage-activated calcium channels (Cav1/Cav2) in excitable cells convert action potentials into Ca CCBs remain a cornerstone of pharmacotherapy for CVDs, with their effects demonstrated across a range of drugs. For example, nimodipine, a dihydropyridine CCBs, blocks the influx of extracellular calcium through L-type voltage-gated calcium channels. In 2018, the European Society of Cardiology and the European Society of Hypertension proposed a conventional definition of hypertension, that is, BP ≥ 140/90 mm Hg. A large body of evidence indicates that selecting appropriate drug combinations is crucial for controlling blood pressure. LTCCBs have been widely used as antihypertensive agents in clinical practice.', '{0.23628699779510498,0.33200883865356445,0.08123327791690826,-0.23012858629226685,0.058064211159944534,0.08828788995742798,-0.10959890484809875,0.3382357954978943,-0.1770092397928238,-1.666373610496521,0.2406747043132782,0.6456370949745178,0.00666152173653245,-0.5412212014198303,-0.8815032839775085,-0.017978807911276817,-0.01484815776348114,0.4984838366508484,0.05559122562408447,0.4552030861377716,-0.684063196182251,-0.29378268122673035,-0.484279602766037,-0.16517648100852966,0.5258508920669556,-0.17075949907302856,-0.17609815299510956,-0.3103984296321869,-0.4887154996395111,-0.3408232033252716,-0.29951444268226624,-1.2056947946548462,0.49917277693748474,0.01116170920431614,0.2996475398540497,0.15302340686321259,-0.14170823991298676,0.9659069180488586,-0.259738951921463,-0.06319377571344376,-0.3260640799999237,0.5521990656852722,0.005799103062599897,-0.652754008769989,-0.19893456995487213,-0.5286605954170227,-0.15944330394268036,0.4