VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 4, 'olling blood pressure. LTCCBs have been widely used as antihypertensive agents in clinical practice. In recent years, many studies have focused on experimental research related to spontaneous hypertension, particularly in terms of blood pressure reduction. Wang et al, As research has progressed, studies on channel-regulating substances have gradually increased. In an experiment by Reyes et al, Arrhythmias typically refer to disturbances in the rate or rhythm of the heartbeat. Sinoatrial node cardiomyocytes exhibit automatic and rhythmic electrical activity, and their rate is influenced by inputs from the autonomic nervous system. For instance, sympathetic nerves increase heart rate by activating the β-adrenergic receptor (β-ARs) signaling cascade, and LTCCs activity facilitates membrane depolarization, serving as a central target of β-ARs signaling. The development of drugs based on plant extracts has become a research hotspot in recent years.', '{0.04975477233529091,-0.23179523646831512,0.026361612603068352,0.422027051448822,-0.017971590161323547,0.1612752079963684,-0.4034641683101654,0.1353282928466797,0.16323669254779816,-1.4488716125488281,0.5329864621162415,0.26052290201187134,0.05308074504137039,-0.5204517841339111,-0.6130561828613281,-0.4951901435852051,-0.06371902674436569,-0.12190435081720352,0.43513253331184387,0.20205260813236237,-0.42391419410705566,0.1203821673989296,-0.42410939931869507,-0.13286973536014557,0.25823724269866943,-0.3975026309490204,0.11996913701295853,-0.421304315328598,-0.20664569735527039,-0.0614188127219677,-0.48015066981315613,-0.900378406047821,0.3280799984931946,0.12567850947380066,0.5601844787597656,0.32186639308929443,0.2749435305595398,1.0564113855361938,-0.15888869762420654,0.17579495906829834,-0.009023175574839115,0.05475834757089615,-0.37694746255874634,-0.9247453808784485,-0.3415695130825043,-0.8939945697784424,-0.47678664326667786,0.1538998782634735,0.1